  \"2016-11-25T21:06:37.402292\",\n\t\"name\": \"201112-schools-and-staffing-survey-17271\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Schools and Staffing Survey, 2011-12
  (SASS 11-12), is a study that is part of the Schools and Staffing Survey (SASS)
  program. SASS 11-12 (http://nces.ed.gov/surveys/sass/) is a survey that covers a
  wide range of topics from teacher demand, teacher and principal characteristics,
  general conditions in schools, principals' and teachers' perceptions of school climate
  and problems in their schools, teacher compensation, district hiring and retention
  practices, to basic characteristics of the student population. The survey was conducted
  using mail, email, and telephone interviews. Schools, teachers, librarians, and
  principals were sampled. Key statistics produced from SASS 11-12 are how many teachers
  and principals remained at the same school, moved to another school, or left the
  profession in the year following the SASS administration.\",\n\t\"license_title\":
